import './App.css';
import Header from './components/Header';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
     <Header/>
     <main className='py-3'>
      <Container>
      <h1>Welcome to Proshop</h1>
      </Container>
     </main>
    </div>
  );
}

export default App;
